class Hello extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            hariu: 100,
        }
    }
    componentDidMount() {
      fetch("http://localhost:3001/users")
        .then(res => res.json())
        .then((result) => {this.setState({
              hariu: 222222222222222222
            });
          },
          (error) => {
            this.setState({
              hariu: 5555555555555555,
            });
          }
        )
    }


    render(){
        return (
            <div>
                     <div className="103"><h1>{this.state.hariu}</h1></div>
            </div>

        );

    }
}

export default Hello;
